import React from 'react';
import{getData, codes} from '../data/stock';
import { Link } from "react-router-dom";
export const StockList=()=>{
    return(<div>
        { codes.map((w)=>
        (<div><Link to={`/StockList/${w}`}>{getData(w).name}</Link><br/></div>))}
     </div>)
}
